import React from "react";
import { Paper, withStyles } from "@material-ui/core";

const styles = {
  paper: {
    width: 175,
    height: 250,
    backgroundColor: "grey",
    margin: "10px auto"
  }
};

export default withStyles(styles)(({ classes }) => {
  return <Paper className={classes.paper} />;
});
